import React from 'react';
import {Link} from "react-router-dom";

const Menu = () =>{
    return(
        <>
            <Link> AboutUs </Link>         
            <Link> ContactUs</Link>
            <br/>           
            <a href="/"> About </a>
            <a href="/Contact"> Contact </a>
        </>
    );
};

export default Menu;
